import React, { useState } from 'react'
import './Card.css'

function Popup(props) {
	return (props.trigger) ? (
		<div className='popup'>
			<div className='popup-inner'>
				<button className='close-btn' onClick={() => props.setTrigger(false)}>Close</button>
				{props.children}
			</div>
		</div>
	) : "";
}

const Card = ({ header, body, imgLink, date, github, devpost }) => {
	const [buttonPopup, setButtonPopup] = useState(false)
	return (
		<>
			<Popup trigger={buttonPopup} setTrigger={setButtonPopup}></Popup>
			<div className="card">
				<div className="cardImage"><img src={imgLink}></img></div>
				<div className="cardContainer">
					<h1 className="cardHeader">{header} </h1>
					<h4 className="cardBody">{body}</h4>
					<button className="cardButton"><a href={github}>View Code</a></button>
					<button className="cardButton"><a href={devpost}>View Project</a></button>
					<h3 className='cardDate'>{date}</h3>
				</div>
			</div>
		</>
	)
}

const Card2 = ({ header, body, imgLink, date, github, demo }) => {
	const [buttonPopup, setButtonPopup] = useState(false)
	return (
		<>
			<Popup trigger={buttonPopup} setTrigger={setButtonPopup}></Popup>
			<div className="card">
				<div className="cardImage"><img src={imgLink}></img></div>
				<div className="cardContainer">
					<h1 className="cardHeader">{header} </h1>
					<h4 className="cardBody">{body}</h4>
					<button className="cardButton"><a href={github}>Github</a></button>
					<button className="cardButton" onClick={() => setButtonPopup(true)}><a>Demo</a></button>
					<h3 className='cardDate'>{date}</h3>
				</div>
			</div>
		</>
	)
}



export default { Card, Card2 }
